    <>
      {commentsData.map((comment) => (
        <>
          <Comment
            key={comment.id}
            comment={comment}
            currentUser={currentUser}
            commentsData={commentsData}
            setCommentsData={setCommentsData}
            setModalOpen={setModalOpen}
            deleteItem={deleteItem}
          />
        </>
      ))}
    </>
  );
};

export default CommentList;
